import React from 'react';
import { 
  EmptyCartContainer, 
  CartLogoComponent,
  EmptyTitle
 } from './cart-container.styles';


const CartContainer = () => {
  return (
    <EmptyCartContainer>
      <CartLogoComponent/>
      <EmptyTitle/>
    </EmptyCartContainer>
  )
}

export default CartContainer;
